window.bookSummaryJSON = "<p>The final battle between the Humans and the Zaltule is drawing near. However, the Arachnids have a secret that will ensure victory and allow them to wipe out the Human race once and for all. </p> <p>In the Strell Empire, former Supreme Overlord Xatul plans his return. He has amassed a fleet to take back control of the Kleese Empire. </p> <p>The Humans realize they need more time to prepare for the coming attack of the Zaltule. To buy the time they need, Fleet Admiral Kelly sends Seventh Fleet deep into the Kleese Empire to draw the attention of the Zaltule. However, even the best-laid plans can sometimes go horribly wrong. </p> <p>This is the climactic conclusion to The Galactic Empire Wars Series. </p>"; 
